import React, { useState, useEffect } from 'react';
import { MapContainer, TileLayer, GeoJSON } from 'react-leaflet';
import axios from 'axios';
import * as turf from '@turf/turf';
import DatePicker from './DatePicker';
import 'leaflet/dist/leaflet.css';
import './styles.css';
import L from 'leaflet';

// Fix Leaflet icons
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png')
});

const layerStyles = {
  baseline: { 
    color: '#ff0000', 
    weight: 3,
    fillOpacity: 0
  },
  comparison: { 
    color: '#00ff00', 
    weight: 2,
    fillOpacity: 0
  },
  erosion: { 
    color: '#ff0000', 
    weight: 3,
    dashArray: '5,5',
    fillColor: '#ff0000',
    fillOpacity: 0.3
  },
  accretion: {
    color: '#00ff00',
    weight: 3,
    dashArray: '5,5',
    fillColor: '#00ff00',
    fillOpacity: 0.3
  }
};

const MapComponent = () => {
  const [mapData, setMapData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleDateSelect = async (endDate) => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.post('http://localhost:5000/get-map-data', {
        end_date: endDate
      });

      if (!response.data.baseline_geojson) {
        throw new Error("Missing baseline data");
      }

      setMapData({
        ...response.data,
        bounds: new L.LatLngBounds(
          new L.LatLng(46.0, -64.0),
          new L.LatLng(47.0, -63.0))
      });
      
    } catch (error) {
      console.error('Error:', error);
      setError(error.response?.data?.error || error.message);
    } finally {
      setLoading(false);
    }
  };

  const simplifyGeometry = (geometry) => {
    try {
      return turf.simplify(turf.feature(geometry), {
        tolerance: 0.001,
        highQuality: true
      }).geometry;
    } catch (e) {
      console.error('Simplification error:', e);
      return geometry;
    }
  };

  const renderGeoJSON = (data, style) => {
    if (!data) return null;
    
    if (data.type === 'FeatureCollection') {
      return data.features.map((feature, index) => (
        <GeoJSON
          key={`feature-${index}`}
          data={feature.geometry}
          style={style}
        />
      ));
    }
    
    return <GeoJSON data={data} style={style} />;
  };

  return (
    <div className="map-container">
      <MapContainer 
        center={[46.5107, -63.4168]}
        zoom={10}
        style={{ height: '100vh', width: '100%' }}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; OpenStreetMap contributors'
        />

        {mapData?.baseline_geojson && (
          renderGeoJSON(mapData.baseline_geojson, layerStyles.baseline)
        )}

        {mapData?.water_boundaries?.comparison && (
          renderGeoJSON(mapData.water_boundaries.comparison, layerStyles.comparison)
        )}

        {mapData?.water_boundaries?.erosion && (
          renderGeoJSON(mapData.water_boundaries.erosion, layerStyles.erosion)
        )}

        {mapData?.water_boundaries?.accretion && (
          renderGeoJSON(mapData.water_boundaries.accretion, layerStyles.accretion)
        )}

        {/* Legend remains same */}
      </MapContainer>

      <div className="sidebar">
        <div className="sidebar-header">
          <h3>PEI Coastal Change Analyzer</h3>
          <DatePicker onDateSelect={handleDateSelect} />
          {loading && <div className="loading-spinner">Processing...</div>}
          {error && <div className="error-message">{error}</div>}
        </div>
      </div>
    </div>
  );
};

export default MapComponent;
